let provider = false
let posterContract = false
let contract = false


let ethereum_instance

if(!ethereum && window.ethereum) {
    ethereum_instance = window.ethereum
} else {
    ethereum_instance = ethereum
}

if (ethereum_instance) {
    provider = new ethers.providers.Web3Provider(ethereum_instance)

    ethereum_instance.on('chainChanged', () => {
        window.location.reload();
    })

    ethereum_instance.on('accountsChanged', () => {
        window.location.reload();
    })
}

async function getNetwork() {
    const { chainId } = await provider.getNetwork()

    if(chainId !== 8) {
        document.getElementById('connectButton').setAttribute('disabled', 'disabled')
        showProgress('Please connect to the Ubiq network')
    } else {
        document.getElementById('connectButton').removeAttribute('disabled')
        showProgress(`Click the "Connect to MetaMask" to start`, '⬆️')
    }
}

if (!provider) {
    console.error("Your browser is not web3 enabled.")
} else {
    getNetwork()
}

async function getPosterBalances(address) {
    let balances = []

    for(let i=0; i<=5; i++) {
        const balance = await posterContract.balanceOf(address, i)
        balances.push({
            id: i,
            quantity: parseInt(balance, 10)
        })
    }

    return balances
}

const getCrypstersIds = (address) => {
    return cryptstersOwners.filter(c => c.owner.toLowerCase() === address.toLowerCase()).map(c => c.id)
}

const removeLiquidity = async (account) => {
    try {
        const signer = await provider.getSigner()
        const contract = await new ethers.Contract(shinobiContractAddress, erc20abi, provider)
        const router = new ethers.Contract(shinobiRouterAddress, routerabi, signer)

        let shinobiBalance = await contract.balanceOf(account)

        const addressA = wrappedUbiqContractAddress // WUBQ
        const addressB = tengransContractAddress // 10grans

        const liquidity = shinobiBalance

        const amountAMin = 1
        const amountBMin = 1

        const to = account

        const deadline = Math.floor(Date.now() / 1000) + 60 * 60 * 24 * 30 // 30 days from now

        const result = await router.removeLiquidity(addressA, addressB, liquidity, amountAMin, amountBMin, to, deadline)

        showProgress(`<a target="_blank" href="https://ubiqscan.io/tx/${result.hash}">View transaction ${result.hash}</a>`)
    } catch(e) {
        console.log('Error occured', e)
    }
}

const wrapUbq = async (ubqBalance = 1) => {
    try {
        const signer = await provider.getSigner()
        const contract = await new ethers.Contract(wrappedUbiqContractAddress, wubqabi, signer)

        const result = await contract.deposit({
            value: ethers.utils.parseEther(ubqBalance.toString())
        })

        showProgress(`<a target="_blank" href="https://ubiqscan.io/tx/${result.hash}">View transaction ${result.hash}</a>`)
    } catch(e) {
        console.log('Error occured', e)
        showProgress(`Error ${e.code}: ${e.message}`)
    }
}

const unwrapWubq = async (wubqBalance = 1) => {
    try {
        const signer = await provider.getSigner()
        const contract = await new ethers.Contract(wrappedUbiqContractAddress, wubqabi, signer)

        const result = await contract.withdraw(ethers.utils.parseEther(wubqBalance.toString()))

        showProgress(`<a target="_blank" href="https://ubiqscan.io/tx/${result.hash}">View transaction ${result.hash}</a>`)
    } catch(e) {
        console.log('Error occured', e)
        showProgress(`Error ${e.code}: ${e.message}`)
    }
}

const showProgress = (html = '', icon = '➡️') => {
    if(html === '') {
        document.getElementById("progress").innerHTML = `${html}`
        document.getElementById("progress").classList.add('d-none')
    } else {
        document.getElementById("progress").classList.remove('d-none')
        document.getElementById("progress").innerHTML = `${icon} ${html}`    
    }
}

const addHtmlToInfoTable = (html) => {
    document.querySelector('#info-table tbody').innerHTML += html
}

